import React, { useState, useEffect } from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import "./Result.css";

const Result = () => {
  const [vulnerabilities, setVulnerabilities] = useState([]);

  useEffect(() => {
    // Fetch data from your API using fetch
    fetch("http://localhost:3001/api/vulnerabilities")
      .then((response) => response.json())
      .then((data) => {
        setVulnerabilities(data);
      })
      .catch((error) => console.error(error));
  }, []);

  return (
    <div>
      <Navbar></Navbar>
      <div className="result-container">
        <h1 className="center-heading">Result</h1>
        <p className="result-p">Contract name: Audit #1</p>
        <p className="result-p">Contract ID: 12344567899</p>
        <details className="collapsible">
          <summary>Reentrancy Attacks</summary>
          <div className="paragraph-content">
            <ul>
              {vulnerabilities
                .filter((vulnerability) => vulnerability.vulnerability_name === "reentrancy-eth")
                .map((vulnerability) => (
                  <li key={vulnerability.vulnerability_id}>
                    {vulnerability.description}
                  </li>
                ))}
            </ul>
          </div>
        </details>
        <details className="collapsible">
          <summary>Integer Overflow/Underflow</summary>
          <div className="paragraph-content">
            <ul>
              {vulnerabilities
                .filter(
                  (vulnerability) => vulnerability.vulnerability_name === "integer-overflow-underflow"
                )
                .map((vulnerability) => (
                  <li key={vulnerability.vulnerability_id}>
                    {vulnerability.description}
                  </li>
                ))}
            </ul>
          </div>
        </details>
        <details className="collapsible">
          <summary>Gas Griefing</summary>
          <div className="paragraph-content">
            <ul>
              {vulnerabilities
                .filter((vulnerability) => vulnerability.vulnerability_name === "gas-griefing")
                .map((vulnerability) => (
                  <li key={vulnerability.vulnerability_id}>
                    {vulnerability.description}
                  </li>
                ))}
            </ul>
          </div>
        </details>
        <p className="result-p" id="result-p">
          {vulnerabilities.length} vulnerabilities found
        </p>
      </div>

      <Footer></Footer>
    </div>
  );
};

export default Result;
